import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './index.css'; // Optional: if you have a CSS file

import App from './App'; // Main component
import Home from './Home'; // Home component
import Search from './Search'; // Search component
import ProtectedRoute from './ProtectedRoute'; // Guarded route component
import reportWebVitals from './reportWebVitals'; // Optional: for measuring performance

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Routes>
        <Route path="/" element={<App />} /> {/* Assuming App is your main component */}
        <Route path="/home" element={<Home />} /> {/* Separate Home component */}
        <Route path="/search" element={<ProtectedRoute element={<Search />} />} /> {/* Protected route for Search */}
      </Routes>
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

// Optional: Performance measuring (if you are using reportWebVitals)
reportWebVitals();
